import React from 'react';
import './Munch.css';
import './frontBackground.'


function App() {
  return (

    <div>
      <head>
        <link href='https://fonts.googleapis.com/css?family=Almendra SC' rel='stylesheet'></link>
      </head>
      <body>
        <h1>Munchkin</h1>
      </body>
    </div>

  );
}

export default App;
